import React from 'react';
import videoLink from './motionplace.mp4';

const Landing = () => {
    return(
      
        <div >
            <video autoPlay loop muted>
        <source src={videoLink} type='video/mp4' />
        </video>
        </div>
       
   
     
       
    
    )
}

export default Landing;
